import React, { Component } from 'react';


class TypingEffect extends Component {
  render() {
    return (
      <div className="typing-container" style={{marginTop:"2em",marginLeft:"4em"}}>
        <div className="typing-text"><i>Elevate your Style using AI Powered Suggestions</i></div>
      </div>
    );
  }
}

export default TypingEffect;
